import {makeStyles} from "@material-ui/core";
import {useDispatch, useSelector} from "react-redux";
import {getTr} from "../actions/tr.action";
import Button from "@material-ui/core/Button/Button";
import TableContainer from "@material-ui/core/TableContainer/TableContainer";
import Paper from "@material-ui/core/Paper/Paper";
import Table from "@material-ui/core/Table/Table";
import TableHead from "@material-ui/core/TableHead/TableHead";
import TableRow from "@material-ui/core/TableRow/TableRow";
import TableCell from "@material-ui/core/TableCell/TableCell";
import TableBody from "@material-ui/core/TableBody/TableBody";
import EnhancedTable from "./AdminTable";
import React from "react";
import {getMaintenance} from "../actions/maintenance.action";

const useStyles = makeStyles({
    table: {
        minWidth: 650,
    },
});

const AdminMaintenance = () => {

    const classes = useStyles();

    const dispatch = useDispatch();

    const adminMaintenanceState = useSelector(appState => {
        return {
            maintenance: appState.maintenance
        };
    });


    const getUnhandledMaintenance = (event) => {
        event.preventDefault();
        dispatch(getMaintenance());

    };


    return (
        <div>
            <Button onClick = {getUnhandledMaintenance}>Show unhandled maintenance requests</Button>
            <TableContainer component={Paper}>
                <Table className={classes.table} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>First Name</TableCell>
                            <TableCell align="right">Last Name</TableCell>
                            <TableCell align="right">Email</TableCell>
                            <TableCell align="right">Phone</TableCell>
                            <TableCell align="right">SMS</TableCell>
                            <TableCell align="right">Time</TableCell>
                            <TableCell align="right">Date</TableCell>
                            <TableCell align="right">Status</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {
                            adminMaintenanceState.maintenance ?
                                adminMaintenanceState.maintenance.map((element) => (
                                    <TableRow key={element.id}>
                                        <TableCell component="th" scope="row">
                                            {element.name}
                                        </TableCell>
                                        <TableCell align="right">{element.roomNum}</TableCell>
                                        <TableCell align="right">{element.doorNum}</TableCell>
                                        <TableCell align="right">{element.date}</TableCell>
                                        <TableCell align="right">{element.status}</TableCell>
                                    </TableRow>
                                ))
                                :
                                <p></p>
                        }
                    </TableBody>
                </Table>
                {
                    adminMaintenanceState.maintenance ?
                        <EnhancedTable  component={'Tr'} rows = {adminMaintenanceState.maintenance}/>
                        :
                        <p></p>
                }

                {/*<EnhancedTable component={'Tr'} rows = {adminTrState.tr}/>*/}
            </TableContainer>
        </div>
    );

}


export default AdminMaintenance;
